import React from 'react'
import SliderCard from "./SliderCard"
// import { Carousel } from "react-bootstrap"


const Slider = () => {
    return (
        <>
            <div className="sliders">
                <div className="slide_container">
                    <SliderCard />
                </div>
            </div>

        </>
    )
}

export default Slider
